import React from "react";

import {Sidebar, Menu, MenuItem, SubMenu} from "react-pro-sidebar";

import {FontAwesomeIcon} from "@fortawesome/react-fontawesome";
import {faHome} from "@fortawesome/free-solid-svg-icons";


function SideBar() {
    return (<Sidebar
        collapsed={true}
        collapsedWidth={"48px"}
        backgroundColor={"#181818"}
        rootStyles={{height: "100vh", display: "flex", flexDirection: "column", borderRight: "1px solid #3E3E3E"}}
    >
        <Menu menuItemStyles={{
            height: "48px",
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
            margin: "0",
            padding: "0",
            color: "#fff",
            fontSize: "16px",
            cursor: "pointer"
        }}>
        <MenuItem icon={<FontAwesomeIcon icon={faHome}/>}>Home</MenuItem>
        <SubMenu title="Components" icon={<FontAwesomeIcon icon={faHome}/>}>
            <MenuItem>Component 1</MenuItem>
            <MenuItem>Component 2</MenuItem>
            <MenuItem>Component 3</MenuItem>
        </SubMenu>
    </Menu>
</Sidebar>)
    ;
}

export default SideBar;
